import React, { useEffect } from 'react'
import { useParams } from 'react-router-dom'

const Session = ({ API_URL }) => {
  const params = useParams()

  useEffect(() => {
    const getSession = async () => {
      await fetch(`${API_URL}/sessions/${params.id}`)
    }
  })

  return (
    <div>{params.id}</div>
  )
}

export default Session
